// src/App.js

import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Home from "./pages/Home";
import Login from "./pages/Login";
import Register from "./pages/Register";
import SchoolRegistrationWizard from "./pages/SchoolRegistrationWizard";
import SchoolDashboard from "./pages/SchoolDashboard";
import PlayerProfile from "./pages/PlayerProfile";
// Import more pages as you build them

// If you use i18n, import once (usually in index.js, but safe here too)
import "./i18n";

export default function App() {
  return (
    <Router>
      <div className="min-h-screen bg-blue-50">
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<SchoolRegistrationWizard />} />
          <Route path="/dashboard" element={<SchoolDashboard />} />
          <Route path="/dashboard" element={<SchoolDashboard />} />
          <Route path="/player/:id" element={<PlayerProfile />} />

          {/* Add more routes as needed */}
        </Routes>
      </div>
    </Router>
  );
}
